--- === core.welcome.panels.intro  ===
---
--- Intro Panel Welcome Screen.

--------------------------------------------------------------------------------
--
-- EXTENSIONS:
--
--------------------------------------------------------------------------------
local log										= require("hs.logger").new("intro")

local image										= require("hs.image")
local timer										= require("hs.timer")
local toolbar                  					= require("hs.webview.toolbar")
local webview									= require("hs.webview")

local config									= require("cp.config")
local generate									= require("cp.web.generate")

local generate									= require("cp.web.generate")

--------------------------------------------------------------------------------
--
-- THE MODULE:
--
--------------------------------------------------------------------------------
local mod = {}

	--------------------------------------------------------------------------------
	-- CONTROLLER CALLBACK:
	--------------------------------------------------------------------------------
	local function controllerCallback(message)

		local result = message["body"][1]

		if result == "introQuit" then
			config.application():kill()
		elseif result == "introContinue" then
			mod.manager.nextPanel(mod._priority)
		end

	end

	--------------------------------------------------------------------------------
	-- GENERATE CONTENT:
	--------------------------------------------------------------------------------
	local function generateContent()

		local result = [[
			<img width="150px" height="150px" src='data:image/jpeg;base64, ' />
			<h1 class="content-heading">]] .. config.appName .. [[</h1>
			<h2 class="content-tagline">]] .. i18n("welcomeTagLine") .. [[</h2>
			<p>]] .. i18n("welcomeIntro") .. [[</p>
			<style>
				p.uiItem {
					display:inline;
					padding-left: 10px;
				}
			</style>
			<p>]] .. generate.button({title = i18n("continue")}, "introContinue") .. " " .. generate.button({title = i18n("quit")}, "introQuit") .. "</p>"

		return result

	end

	--------------------------------------------------------------------------------
	-- INITIALISE MODULE:
	--------------------------------------------------------------------------------
	function mod.init(deps)

		generate.setWebviewLabel(deps.manager.getLabel())

		mod._id 			= "intro"
		mod._priority		= 20
		mod._contentFn		= generateContent
		mod._callbackFn 	= controllerCallback

		mod.manager = deps.manager

		mod.manager.addPanel(mod._id, mod._priority, mod._contentFn, mod._callbackFn)

		return mod

	end

--------------------------------------------------------------------------------
--
-- THE PLUGIN:
--
--------------------------------------------------------------------------------
local plugin = {
	id				= "core.welcome.panels.intro",
	group			= "core",
	dependencies	= {
		["core.welcome.manager"]	= "manager",
	}
}

--------------------------------------------------------------------------------
-- INITIALISE PLUGIN:
--------------------------------------------------------------------------------
function plugin.init(deps)
	return mod.init(deps)
end

return plugin